import React from "react";
import "./Dice.scss"

type DiceProps = {
    header: string,
    options: string[]
}

const Dice: React.FC<DiceProps> = ({header, options}) => {

    return (
        <div className="Dice">
            <h4>{header}</h4>
            <div className="Square">
                <h5>{options[getRandomInt(options.length)]}</h5>
            </div>
        </div>
    )
};

function getRandomInt(max: number) {
    return Math.floor(Math.random() * Math.floor(max));
}

export default Dice
